import { useEffect, useState } from 'react';
import * as api from './frontend/api';

function App() {
    const [greeting, setGreeting] = useState('');

    useEffect(() => {
        async function fetchGreeting() {
            const result = await api.hello();
            setGreeting(result);
        }
        fetchGreeting();
    }, []);

    return (
        <div>{greeting}</div>
    );
}

export default App;
